import React from "react";
import "./Filter.scss";

function Filter() {
  return (
    <div className="filter">
      <div className="filter-container">
        <div className="filter-header">
          <span>Brand</span>
        </div>
        <div className="filter-body"></div>
      </div>
    </div>
  );
}

export default Filter;
